import React, { useState, useContext } from 'react';
import { DataContext } from '../DataProvider';

const FormInput = () => {
  const [products, setProducts] = useContext(DataContext);
  const [productName, setProductName] = useState([]);

const options = [
  { value: 'value-1', text: 'text-1' },
  { value: 'value-2', text: 'text-2' },
  { value: 'value-3', text: 'text-3' },
];


  const onSubmitHandler = (e) => {
    e.preventDefault();
    setProducts([...products, { name: productName, complete: true }]);
    console.log('my product: ', productName);
    console.log('products');
  };

  return (
    <div>
      <form
        autoComplete="off"
        className="form-container"
        onSubmit={onSubmitHandler}
      >
        <label for="cars">Products:</label>
        <select
          id="products"
          name="products"
          onChange={(e) => setProductName(e.target.value)}
        >
          <option value="MacBook Pro">MacBook Pro</option>
          <option value="Sure SM58">SM58</option>
          <option value="Head Prestige Pro">Head</option>
          <option value="fritzkola">fritzkola</option>
        </select>
        <button type="submit" onChange={(e) => setProductName(e.target.value)}>
          Add To Cart
        </button>
      </form>
    </div>
  );
};

export default FormInput;
